import { Component } from "react";
import Textfield from '../components/widgets/textfield';
import Button from '../components/widgets/button';


export default class Login extends Component {
    render() {
        return (
            <form class="center Glass-plate login">
                <Textfield name="email" icon="https://img.icons8.com/color/50/000000/email.png" cont="email" />
                <Textfield name="password" icon="https://img.icons8.com/color/50/000000/email.png" cont="P" />
                <Button txt="click" />
            </form>
        );
    }
}
